class Editora {
    codEditora: number;
    nome: string;

    constructor(codEditora: number, nome: string) {
        this.codEditora = codEditora;
        this.nome = nome;
    }

    getCodEditora(): number {
        return this.codEditora;
    }

    getNome(): string {
        return this.nome;
    }


    setCodEditora(codEditora: number): void {
        this.codEditora = codEditora;
    }

    setNome(nome: string): void {
        this.nome = nome;
    }
}

export default Editora;
